import SiderBarItemHeader from '../../../components/SiderBar/SiderBarItemHeader'

export default class PersonalInfo extends Component {
  render() {
    return (
      <div className="mt-5">
        <SiderBarItemHeader use-btn={true} btn-text="BTN" header-text="Info" />
      </div>
    )
  }
}
